import request from '@/utils/request';
import { host } from "./utils";
export function createPano(data) {
  return request({
    url: host + '/api/pano/add',
    method: 'post',
    data: data
  });
}
export function getPanoList(params) {
  return request({
    url: host + '/api/pano/list',
    method: 'get',
    params: params
  });
}
export function getPanoPage(page, params) {
  return request({
    url: host + '/api/pano/page/' + page,
    method: 'get',
    params: params
  });
}
export function getPanoIndexList(params) {
  return request({
    url: host + '/api/pano/index_list',
    method: 'get',
    params: params
  });
}
export function getPano(params) {
  return request({
    url: host + '/api/pano/get',
    method: 'get',
    params: params
  });
}
export function deletePano(params) {
  return request({
    url: host + '/api/pano/delete',
    method: 'get',
    params: params
  });
}
